import React from 'react'
import s from './Error.module.css'
import Header from './Header/Header';
import Content from './Content/Content';
import Window from '../../../HOC/Window/window';
import err from '../../../Images/err.svg'

const Error = (props) => {

    return (
        <div className={props.className} onClick={props.onClick}>
        <Window ColapsItem={ props.ColapsItem } Id={props.Id} SelectedItem={ props.SelectedItem } SetSelectedItem={ props.SetSelectedItem } 
        ContentComponent = { <div>{ <Content SelectedItem={ props.SelectedItem } SetSelectedItem={ props.SetSelectedItem }  /> }</div> } 
        WindowName={'Warning'} MainButtons={[1, 2, 1]} WindowIcon={err}
        width = {"15%"}
        />
        </div>
    );
}


export default Error;
